import Avatar from '@material-ui/core/Avatar';
import { makeStyles } from '@material-ui/core/styles';
import img from './doc.jpg';
// import Container from '@material-ui/core/Container';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col'; 
import Container from 'react-bootstrap/Container';
import { AiOutlineInstagram , AiOutlineFacebook,AiFillTwitterCircle,AiFillLinkedin} from "react-icons/ai";      

const useStyles = makeStyles((theme) => ({
    large: {
      width: theme.spacing(25),
      height: theme.spacing(25),
    },
  }));

function Home() {
  const classes = useStyles();
  return (
     <div>
    <Container>

        <Col style={{}}>
            <Row>
            {/* <Avatar alt="Dr. Bharath Kumar" className={classes.large} src={img} style={{top:"150px", position:"absolute"}}/> */}
            <img src={img}  width="300" height="300"  style={{verticalAlign:"top", position:"center", marginTop:"100px"}}/>
            </Row>
            <Row>
                <Typography variant="h3"  gutterBottom style={{fontFamily: 'Roboto Slab'}}>
                    DR. BHARATH KUMAR B

                </Typography>
                <Typography variant="h5"  gutterBottom style={{fontFamily: 'Roboto Slab'}}>
                    <i>MBBS, PGDSM (Sports Medicine)</i>
                </Typography>
            </Row>
            <br/>
            <Row>
            <AiOutlineInstagram size="40"/>
            <AiOutlineFacebook size="40"/>
            <AiFillTwitterCircle size="40"/>
            <AiFillLinkedin size="40"/>

            </Row>
        </Col>

        <hr/>



    </Container>  
    <Container fluid="true">
        <div className="row justify-content-md-center">
            <div className="col col-lg-8">
            <Typography variant="h6" style={{fontFamily: 'Roboto Slab', margin:"20px"}}>
                Dr. Bharath Kumar B is an Allopathic Doctor specialized in Sports Medicine from the prestigious Netaji Subhas National Institute of Sports. He practices Sports Medicine, Exercise Medicine, and Nutritional Medicine. He has completed professional training in Low Carbohydrate High Fat/Ketogenic Nutrition & Treatment from Nutrition Network.
He is the Founder, Director of Kinesis Sports Clinic, which offers Sports Medicine and Sports Nutrition services to athletes. He is also the Creator & Program Director of MediFit, an online Medical Weight Loss program
            </Typography>
            </div>
            <div className="col col-lg-4">
                Data
            </div>
        </div>

    </Container>


    </div>
  );
}

export default Home;
